import React from "react";
import footer from "./images/footer.png";

function Footer() {
  return (
    <div>
      <div className="footer">
        <img src={footer} className="second_footer_img" />
        <h3>What it's for</h3>
      </div>
    </div>
  );
}

export default Footer;
